$(document).ready(function(){   
    $(window).scroll(function () {
        if ($(this).scrollTop() > 200) {
            $('.scroller').fadeIn();
        } else {
            $('.scroller').fadeOut();
        }
    });
    $('.scroller').click(function () {
        $('body,html').animate({
            scrollTop: 0
        }, 400);
        return false;
    });
});

$(document).on('submit', '.search-form', function (e) {
	var textField = $(this).find('input[type=text]');
	if (textField.val().length === 0) {
		e.preventDefault();
		e.stopPropagation();
		textField.focus();
	}
});

$(function() {
    // РІС‹Р·С‹РІР°РµРј С„РѕСЂРјСѓ
    $(document).on("click", ".call_get_price_form", function(e) {
    	e.preventDefault();// РѕС‚РјРµРЅСЏРµРј РїРµСЂРµС…РѕРґ РїРѕ СЃСЃС‹Р»РєРµ

    	var this_ = $(this);
    	if(this_.hasClass("disabled"))
    		return false;
        
        this_.addClass("disabled");

        $.ajax({
            url: "/include/popups/get_price_popup.php",
            type: "POST",
            data: {},
            success: function(data) {
            	$("body").append(data);
            	$("#get_price-popup").fadeIn();
        	this_.removeClass("disabled");
            }
        });
    });

    // Р° СЌС‚Рѕ РґР»СЏ Р·Р°РєСЂС‹С‚РёСЏ С„РѕСЂРјС‹
    $(document).on("click", ".close_form", function(e) {
        e.preventDefault();
        $("#get_price-popup").hide().remove();
    });
});

function toggleHeader(){
	var scroll_status = $(document).scrollTop();
	    if(scroll_status > 31)
	        $(".header__main").addClass("header_fixed");
	    else
	        $(".header__main").removeClass("header_fixed");
	}
	
	$(document).scroll(function(){
	    toggleHeader();
	});

