; /* Start:"a:4:{s:4:"full";s:59:"/local/templates/onlineshop/assets/js/app.js?16104542237761";s:6:"source";s:44:"/local/templates/onlineshop/assets/js/app.js";s:3:"min";s:0:"";s:3:"map";s:0:"";}"*/
var app = {
    init: function () {
        app.events.productPopup();
        app.events.forms();
        app.events.searchTitle();
        app.events.clientsBlocks();


        app.grecaptcha();

        app.onSearchClose();


        window.numberPretty = function (x) {
            return x.toString().replace(/\B(?=(\d{3})+(?!\d))/g, "");
        };
    },
    events: {
        clientsBlocks: function () {
            let checkEmpty = function () {
                setTimeout(function () {
                    $('.clients-section__group').show();
                    $('.clients-section .container .row .h2').each(function (index, item) {
                        let visibleElements = $(item).parents('.row').next().find('div.col-lg-3.col-md-4.col-6:visible').length;
                        if (visibleElements) {
                            $(item).parents('.clients-section__group').show();
                        } else {
                            $(item).parents('.clients-section__group').hide();
                        }
                    });
                }, 1);
            };

            $('.client-select select').on('change', checkEmpty);
            checkEmpty();
        },
        productSliders: function () {
            $('.item-slider').slick({
                arrows: false,
                asNavFor: '.item-slider-preview',
                slidesToShow: 1,
                fade: true,
                responsive: [
                    {
                        breakpoint: 768,
                        settings: {
                            dots: true,
                            fade: false,
                            customPaging: function (slider, i) {
                                // this example would render "tabs" with titles
                                return '<span class="slick-dot"></span>';
                            }
                        }
                    },

                ]
            });

            $('.item-slider-preview').slick({
                vertical: true,
                slidesToShow: 5,
                arrows: false,
                slidesToScroll: 5,
                focusOnSelect: true,
                verticalSwiping: true,
                asNavFor: '.item-slider',

            });
        },
        searchTitle: function () {
            /*$('.search-form__input').off('focusout').on('focusout', function (e) {
                var $link = $('.search-form__result a:active').attr('href');
                $('.search-form__result').hide();
                if ($link && $link.length > 0) {
                    window.location.href = $link;
                }
            });*/
        },
        changeOffers: function () {
            $('.js-offers').on('change', function () {
                var treevalue = $(this).find('option:selected').data('treevalue');
                $('li[data-treevalue="' + treevalue + '"]').click();
                $('.nice-select.js-offers').toggleClass('open');
            });
        },
        forms: function () {
            //$(".form-validate").off('submit');
        },
        productPopup: function () {
            $(document.body).off('click', '[data-toggle="modal"]').on('click', '[data-toggle="modal"]', function (e) {
                e.preventDefault();

                var hrefModal = $(this).attr('data-target'),
                    productId = $(this).attr('data-product-id');

                $.ajax({
                    url: '/ajax/product.ajax.php',
                    dataType: "json",
                    data: {
                        "PRODUCT_ID": productId
                    },
                    success: function (result) {
                        if ($(hrefModal).length > 0 && result.isSuccess) {

                            $(hrefModal).find('.item__body').html(result.html);
                            app.events.productToCart();
                            app.events.changeOffers();
                            $('select').niceSelect();

                            $(hrefModal).fadeIn(300);

                            bodyScrollLock.clearAllBodyScrollLocks();
                            bodyScrollLock.disableBodyScroll(hrefModal, bodyScrollOptions);

                            app.events.productSliders();

                            setTimeout(function () {
                                $(hrefModal).find('.slick-slider').slick('setPosition');
                            }, 0);
                        } else {
                            console.error(result);
                        }
                    }
                });
            });
        },
        productToCart: function () {
            $(document).on('keypress keyup blur', '.only-digits', function (event) {
                $(this).val(numberPretty($(this).val().replace(/[^0-9]/g, '')));

                if ((event.which < 48 || event.which > 57) && event.which !== 32) {
                    event.preventDefault();
                }

            });
        }
    },
    slick: {
        productSliders: function () {
            $('.item-slider').slick({
                arrows: false,
                asNavFor: '.item-slider-preview',
                slidesToShow: 1,
                fade: true,
                responsive: [
                    {
                        breakpoint: 768,
                        settings: {
                            dots: true,
                            fade: false,
                            customPaging: function (slider, i) {
                                // this example would render "tabs" with titles
                                return '<span class="slick-dot"></span>';
                            }
                        }
                    },

                ]
            });

            $('.item-slider-preview').slick({
                vertical: true,
                slidesToShow: 5,
                arrows: false,
                slidesToScroll: 5,
                focusOnSelect: true,
                verticalSwiping: true,
                asNavFor: '.item-slider',

            });
        }
    },
    func: {
        reformatted_price: function (priceFormatted) {
            if (typeof priceFormatted === 'number') {
                priceFormatted = priceFormatted.toString();
            }
            return priceFormatted.split(' ')[0] + ' в‚Ѕ';
        },
        formatted_price: function (price, returnPrice = false) {
            if (returnPrice) {
                return parseFloat(price)
                    .toFixed(2);
            }
            return Number(
                parseFloat(price)
                    .toFixed(0)
            )
                .toLocaleString('ru-RU')
                .replace('.', ',') + ' в‚Ѕ';
        }
    },

    grecaptcha() {
        if (window.grecaptcha) {
            window.grecaptcha.ready(function () {
                $('form').each(function (index, form) {
                    window.grecaptcha.execute(RECAPTCHA_SITE_KEY, {action: form.name})
                        .then(function (token) {
                            $(form).prepend($('<input>', {
                                type: 'hidden',
                                name: 'grecaptcha_token',
                                value: token,
                            }));
                        });
                });
            });
        }
    },
    onSearchClose() {
        $(document).on('click', '.search-result__close', function () {
            $('input.search-result__input').val('');
            return false;
        });

    }
};

